import { FC } from "react";

export const Home: FC = () => {
  return (
    <div>
      <h1>Welcome to Our Home Page</h1>
      <p>
        Welcome to our website! We are dedicated to offering the best products
        and services to our customers. Here, you'll find all the information you
        need about our company, our product line, and the values we stand for.
        We aim to provide top-quality products and exceptional customer support.
        Check out our products or feel free to contact us for any inquiries.
      </p>

      <h2>Find Us</h2>
      <p>
        Our main office is located in the heart of Lisbon, Portugal. Feel free
        to visit us at the address below or use the map to find directions.
      </p>

      {/* Google Maps Embed */}
      <iframe
        title="Volkswagen Digital Solutions"
        src="https://www.google.com/maps?hl=pt-PT&gl=es&um=1&ie=UTF-8&fb=1&sa=X&ftid=0xd193312495a338f:0x3855b9871c40fb8d"
        width="600"
        height="450"
        style={{ border: 0 }}
        allowFullScreen={true}
        loading="lazy"
      ></iframe>
    </div>
  );
};
